DROP DATABASE IF EXISTS `WhatsApp`;
CREATE database `WhatsApp`;
USE `WhatsApp`;

CREATE TABLE User(
   user_id      INTEGER AUTO_INCREMENT
  ,name         VARCHAR(14) NOT NULL 
  ,phone_number LONG NOT NULL 
  ,group_id     VARCHAR(11)
  ,country      VARCHAR(49) NOT NULL 
  ,primary key(user_id)
);

CREATE TABLE deleted_userid(
   user_id      INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,name         VARCHAR(14) NOT NULL 
  ,phone_number LONG NOT NULL 
  ,group_id     VARCHAR(11)
  ,country      VARCHAR(49) NOT NULL 
);
delimiter $$
create trigger user_delete
before delete
on User
for each row
begin
value(old.user_id, old.name, old.phone_number, old.group_id, old.country);
end $$
delimiter ;

CREATE TABLE null_group_id(
	user_id      INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
  #,messageId         INTEGER  NOT NULL
  ,message      VARCHAR(49) NOT NULL
  );
  delimiter //
  create trigger
  check_null_dob
  after insert
  on User
  for each row
  begin
  if new.group_id is null then
  values (new.user_id, concat(new.name, ' is not in any group'));
  end if;
  end //
  delimiter //

#independent trigger
delimiter //
create trigger check_phone_number 
before insert on User
for each row 
if new.phone_number < 999999999 OR new.phone_number > 9999999999 then set new.phone_number = -1;
end if; // 


create index user_name
on User(name);

create index user_country
on User(country);




