   group_id     INTEGER AUTO_INCREMENT
  ,group_name   VARCHAR(10) NOT NULL
  ,no_of_membes INTEGER  NOT NULL
  ,users_id      VARCHAR(800) NOT NULL 
  ,primary key(group_id) 
);

