CREATE TABLE Chat(
   chat_id     INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,sender_id   INTEGER  NOT NULL
  ,receiver_id INTEGER  NOT NULL
);


CREATE TABLE Chat_History(
   chat_id       INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,sender_id     INTEGER 
  ,receiver_id   INTEGER 
  ,date          DATE 
  ,time          VARCHAR(7)
  ,decription    VARCHAR(134)
  ,chat_in_group VARCHAR(3)
  ,group_id      INTEGER 
);

create index chatHistory_description
on Chat_History(decription);


CREATE TABLE C_all(
   call_id     INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,sender_id   INTEGER  NOT NULL
  ,receiver_id INTEGER  NOT NULL
  ,type        VARCHAR(5) NOT NULL
);


CREATE TABLE Call_History(
   call_id       INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,sender_id     INTEGER  NOT NULL
  ,receiver_id   INTEGER  NOT NULL
  ,date          DATE  NOT NULL
  ,time          VARCHAR(7) NOT NULL
  ,type          VARCHAR(5) NOT NULL
  ,call_in_group VARCHAR(3) NOT NULL
  ,group_id      INTEGER 
  ,duration      VARCHAR(8) NOT NULL
);


CREATE TABLE S_tatus(
   user_id     INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,description VARCHAR(31) NOT NULL
);


CREATE TABLE Status_Group(
   group_id    INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,description VARCHAR(31)
);


CREATE TABLE Media(
   file_id     INTEGER  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,file_name   VARCHAR(10) NOT NULL
  ,user_id     INTEGER  NOT NULL
  ,receiver_id INTEGER  NOT NULL
  ,type        VARCHAR(10) NOT NULL
  ,action      VARCHAR(7) NOT NULL
);
